```json
{
  "application": "SLURM",
  "details": {
    "resource_requirements": {
      "nodes": 1,
      "partition": "preemptable_q",
      "cpus_per_task": 16,
      "time": "10:00:00",
      "account": "nmayhall_group",
      "job_name": "test13"
    },
    "software_requirements": {
      "modules": [
        "intel/2019b",
        "Anaconda3/2020.11",
        "gcc/9.2.0"
      ],
      "environment": "myenv",
      "languages": [
        "python",
        "julia"
      ]
    },
    "other": {
      "rsync": true,
      "temporary_directory": "TMPDIR"
    }
  }
}
```

This script runs on the **SLURM** workload manager. 

The script requests a single node (**--nodes=1**) from the **preemptable_q** partition. It requests **16 CPUs per task** (**--cpus-per-task=16**) and a runtime limit of **10 hours** (**-t 10:00:00**). The script uses the **nmayhall_group** account (**--account=nmayhall_group**) and names the job **test13** (**--job-name test13**).

The script loads several software modules: **intel/2019b**, **Anaconda3/2020.11**, and **gcc/9.2.0**. It also activates a Python virtual environment called **myenv**.

The script uses both Python and Julia for execution. The script also utilizes rsync for data transfer and uses the **TMPDIR** environment variable for temporary files.
